import WorkingOnProject from '../components/WorkingOnProject/WorkingOnProject'


export default function Home() {
  return (
    <Container>
     <Hero/>
     {/* <Projects/> */}
     <WorkingOnProject/>
     <About/> 
     <ViewMyResume/>
    </Container>
  )
}
